CREATE PROCEDURE [dbo].[UserUpdateCommand]
@pId int,
@pName nvarchar(30),
@pSurname nvarchar(30),
@pBithdate date,
@pOccupation nvarchar(30),
@pOrderHiringNumber int,
@pOrderDismissNumber int
AS
SET NOCOUNT ON
UPDATE dbo.Employee
SET
Name = @pName,
Surname = @pSurname,
Birthdate = @pBithdate,
Occupation = @pOccupation,
OrderHiringNumber = @pOrderHiringNumber,
OrderDismissNumber = @pOrderDismissNumber
WHERE Id = @pId
RETURN
GO
